import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import UpdateExpense from './routes/UpdateExpense';
import Home from './routes/Home';

const App = () => {
    return (
        <div>
            <Router>
                <Switch></Switch>
                <Route path='/' Component={Home}></Route>
                <Route path='/update' Component={UpdateExpense}></Route>

            </Router>


        </div>
    );
    }

export default App;
